import React, { Component, useState } from 'react';
import TodoSubList from './todosublist'
import ShowListItem from './showListItems'
import CreateTask from './createTask'
import { useDispatch, useSelector } from "react-redux"
import { toogleShow } from "../redux/actions"
import GetDataFromAPI from "./getDataAPI"
import axios from "axios"
import "../App.css"
import CreateCollection from './createCollection';

const createList = (e) => {

}
const fetchLists = () => { }

const TodoList = (props) => {
    const [list, setList] = useState("")
    const [modal, setModal] = useState(false)

    //setModal
    const toogleModal = () => {
        setModal(!modal);
        console.log("modal", modal)
    }
    const changeList = (e) => {
        setList(e.target.value);
    }
    //set up state from app.js
    let content = (
        <div>
            <div className="main">
                <div className="main-menu">
                    <div className="menu-boxes">
                        <div className="btn-box">
                            <button >ADD DEPARTMETN</button>
                        </div>
                    </div>
                    <div className="footer">
                        <div className="footer-box">
                            <button type="submit" onClick={() => toogleModal()}>Add Department</button>
                        </div>
                    </div>

                </div>
                <div className="main-content">
                    {modal && <CreateCollection
                        content={
                            <input value={list} onChange={(e) => setList(e)}></input>
                        }
                        listState={list}
                        changeListState={setList}
                        closeModal={toogleModal}
                    />}
                    <CreateTask />
                    <ShowListItem />

                </div>

            </div>


        </div>
    )
    return content
}


export default TodoList;
